export default makeStyles((theme) => ({
    root:{
        display: 'flex',
    },
    details:{
        display:'flex',
        flexDirection: 'column'
    },
    itemImage:{
        width: '77px',
        height: '77px',
        
    },
    itemName:{
        fontFamily: "Roboto",
        fontWeight: '600',
        fontSize: '14px',
